import React from 'react';
import './About.css'


function About() {
  return (
    <div className='about'>
      <h1>About me</h1>
      <p style={{paddingTop: '25px',}}>
        I am a young and eager to learn full stack developer. From Michigan, based in Tennessee.
      </p>
      <h2></h2>
    </div>
  );
}

export default About;
